In C, you can round a `double` value to 2 decimal places using the `round()` function from `math.h` library. Here's an example:

```c
#include <stdio.h>
#include <math.h>

int main() {
    double number = 12.45678;
    double rounded_number = round(number * 100) / 100; // Scale up, round, then scale down

    printf("Rounded number: %.2f\n", rounded_number);

    return 0;
}
```

This code works as follows:

* It multiplies the input number by 100 (which effectively shifts the decimal point two positions to the right)
* The result is rounded to the nearest whole number (to essentially rounding the original value to two decimal places)
* The rounded value is then divided by 100 (to shift the decimal back where it originally was)

The result will be printed as `12.46`.

Note that this approach uses a trick to actually round halfway cases towards even, also known as "banker's rounding". For other types of rounding you may need a different approach.

Alternatively you can use `printf("%.2f")` as the formatting string, but that only formats output and does not change actual value of variable. 

